import React, { Component } from 'react';
import DOP from '../contents/DOP';
import LDM from '../contents/LDM';

class Work extends Component {
    render() {
        return (
            <div>
                <section class="work" id="work">
                    <div class="row">
                        <h2>My Work</h2>
                        <div class="work__boxes">
                            <DOP />
                            <LDM />
                        </div>
                    </div>
                </section>
            </div>
        )
    }
}

export default Work;
